import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { 
  ExternalLink, 
  TrendingUp, 
  Database, 
  Brain, 
  Shield, 
  Users,
  Zap,
  Target,
  ChevronDown,
  ChevronUp,
  Globe,
  Award,
  Building,
  Briefcase
} from 'lucide-react';

const ProjectCard = ({ project, isSelected, onClick }) => {
  const [showDetails, setShowDetails] = useState(false);

  const getSynergyColor = (synergy) => {
    if (synergy >= 9.0) return 'from-blue-600 to-blue-800';
    if (synergy >= 8.0) return 'from-blue-500 to-blue-700';
    if (synergy >= 7.0) return 'from-blue-400 to-blue-600';
    return 'from-gray-400 to-gray-600';
  };

  const getSynergyLabel = (synergy) => {
    if (synergy >= 9.0) return 'Maximum Synergy';
    if (synergy >= 8.0) return 'High Synergy';
    if (synergy >= 7.0) return 'Medium Synergy';
    return 'Limited Synergy';
  };

  const getTypeColor = (type) => {
    switch(type) {
      case 'Maximum Synergy': return 'bg-blue-100 text-blue-800 border-blue-200';
      case 'High Synergy': return 'bg-indigo-100 text-indigo-800 border-indigo-200';
      case 'Medium Synergy': return 'bg-purple-100 text-purple-800 border-purple-200';
      default: return 'bg-gray-100 text-gray-800 border-gray-200';
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { 
        duration: 0.5,
        ease: "easeOut"
      }
    },
    hover: {
      y: -8,
      scale: 1.02,
      transition: {
        duration: 0.3,
        ease: "easeInOut"
      }
    }
  };

  const detailVariants = {
    hidden: { 
      opacity: 0, 
      height: 0,
      transition: { duration: 0.3 }
    },
    visible: { 
      opacity: 1, 
      height: "auto",
      transition: { duration: 0.5, ease: "easeOut" }
    }
  };

  return (
    <motion.div
      variants={cardVariants}
      initial="hidden"
      animate="visible"
      whileHover="hover"
      className={`
        relative bg-white rounded-2xl shadow-lg border border-gray-100 
        overflow-hidden cursor-pointer transition-all duration-300
        ${isSelected ? 'ring-2 ring-blue-500 shadow-xl' : 'hover:shadow-xl'}
      `}
      onClick={() => {
        onClick(project);
        setShowDetails(!showDetails);
      }}
    >
      {/* Gradient background overlay */}
      <div className={`absolute inset-0 bg-gradient-to-br ${getSynergyColor(project.synergy)} opacity-5`} />

      {/* Main Card Content */}
      <div className="relative p-6">
        {/* Header */}
        <div className="flex items-start justify-between mb-4">
          <div className="flex-1">
            <div className="flex items-center gap-3 mb-2">
              <h3 className="text-xl font-bold text-gray-900 group-hover:text-blue-600 transition-colors">
                {project.name}
              </h3>
              <a
                href={project.website}
                target="_blank"
                rel="noopener noreferrer"
                className="p-1 text-gray-400 hover:text-blue-600 transition-colors"
                onClick={(e) => e.stopPropagation()}
              >
                <ExternalLink size={16} />
              </a>
            </div>

            <div className="flex flex-wrap gap-2 mb-3">
              <span className={`px-3 py-1 rounded-full text-xs font-medium border ${getTypeColor(project.type)}`}>
                {project.type}
              </span>
              <span className="px-3 py-1 rounded-full text-xs font-medium bg-gradient-to-r from-emerald-100 to-emerald-200 text-emerald-800 border border-emerald-300">
                {project.category}
              </span>
            </div>
          </div>

          {/* Synergy Score */}
          <div className="flex flex-col items-center">
            <div className={`
              w-16 h-16 rounded-full bg-gradient-to-br ${getSynergyColor(project.synergy)}
              flex items-center justify-center text-white font-bold text-lg shadow-lg
            `}>
              {project.synergy}
            </div>
            <span className="text-xs text-gray-500 mt-1 text-center">
              {getSynergyLabel(project.synergy)}
            </span>
          </div>
        </div>

        {/* Description */}
        <p className="text-gray-600 text-sm mb-4 leading-relaxed">
          {project.description}
        </p>

        {/* Metrics Grid */}
        <div className="grid grid-cols-3 gap-3 mb-4">
          <div className="text-center p-2 bg-gray-50 rounded-lg">
            <Database className="w-5 h-5 mx-auto mb-1 text-blue-600" />
            <div className="text-lg font-bold text-gray-900">{project.dataFocus}</div>
            <div className="text-xs text-gray-500">Data Focus</div>
          </div>
          <div className="text-center p-2 bg-gray-50 rounded-lg">
            <Brain className="w-5 h-5 mx-auto mb-1 text-purple-600" />
            <div className="text-lg font-bold text-gray-900">{project.aiIntegration}</div>
            <div className="text-xs text-gray-500">AI Integration</div>
          </div>
          <div className="text-center p-2 bg-gray-50 rounded-lg">
            <Shield className="w-5 h-5 mx-auto mb-1 text-green-600" />
            <div className="text-lg font-bold text-gray-900">{project.decentralization}</div>
            <div className="text-xs text-gray-500">Decentralization</div>
          </div>
        </div>

        {/* Key Features */}
        <div className="mb-4">
          <h4 className="text-sm font-semibold text-gray-700 mb-2 flex items-center gap-2">
            <Zap className="w-4 h-4 text-yellow-500" />
            Key Features
          </h4>
          <div className="flex flex-wrap gap-1">
            {project.keyFeatures.slice(0, 3).map((feature, index) => (
              <span
                key={index}
                className="px-2 py-1 bg-blue-50 text-blue-700 text-xs rounded-md border border-blue-200"
              >
                {feature}
              </span>
            ))}
            {project.keyFeatures.length > 3 && (
              <span className="px-2 py-1 bg-gray-100 text-gray-600 text-xs rounded-md">
                +{project.keyFeatures.length - 3} more
              </span>
            )}
          </div>
        </div>

        {/* Expand/Collapse Button */}
        <div className="flex justify-center">
          <button
            onClick={(e) => {
              e.stopPropagation();
              setShowDetails(!showDetails);
            }}
            className="flex items-center gap-2 px-4 py-2 text-sm font-medium text-blue-600 hover:text-blue-800 hover:bg-blue-50 rounded-lg transition-colors"
          >
            {showDetails ? (
              <>
                <ChevronUp size={16} />
                Show Less
              </>
            ) : (
              <>
                <ChevronDown size={16} />
                Show Details
              </>
            )}
          </button>
        </div>
      </div>

      {/* Detailed Information */}
      <AnimatePresence>
        {showDetails && (
          <motion.div
            variants={detailVariants}
            initial="hidden"
            animate="visible"
            exit="hidden"
            className="border-t border-gray-100 bg-gray-50"
          >
            <div className="p-6 space-y-6">
              {/* Detailed Analysis */}
              <div>
                <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center gap-2">
                  <Target className="w-5 h-5 text-blue-600" />
                  Detailed Analysis
                </h4>
                <p className="text-gray-700 text-sm leading-relaxed">
                  {project.detailedAnalysis}
                </p>
              </div>

              {/* Ocean Protocol Integration */}
              <div>
                <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center gap-2">
                  <Globe className="w-5 h-5 text-blue-600" />
                  Ocean Protocol Integration
                </h4>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-3">
                  {Object.entries(project.oceanIntegration).map(([key, value]) => (
                    <div key={key} className="p-3 bg-white rounded-lg border border-gray-200">
                      <div className="font-medium text-gray-900 text-sm mb-1 capitalize">
                        {key.replace(/([A-Z])/g, ' $1').trim()}
                      </div>
                      <div className="text-gray-600 text-xs">{value}</div>
                    </div>
                  ))}
                </div>
              </div>

              {/* Technical Capabilities */}
              <div>
                <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center gap-2">
                  <Brain className="w-5 h-5 text-purple-600" />
                  Technical Capabilities
                </h4>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-2">
                  {project.technicalCapabilities.map((capability, index) => (
                    <div key={index} className="flex items-center gap-2 text-sm text-gray-700">
                      <div className="w-2 h-2 bg-purple-400 rounded-full"></div>
                      {capability}
                    </div>
                  ))}
                </div>
              </div>

              {/* Market & Company Info */}
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                {/* Market Position */}
                <div>
                  <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center gap-2">
                    <Award className="w-5 h-5 text-yellow-600" />
                    Market Position
                  </h4>
                  <p className="text-gray-700 text-sm">{project.marketPosition}</p>

                  <div className="mt-3 space-y-2">
                    <div className="flex items-center gap-2 text-sm">
                      <Briefcase className="w-4 h-4 text-green-600" />
                      <span className="font-medium">Funding:</span>
                      <span className="text-gray-700">{project.fundingStatus}</span>
                    </div>
                    <div className="flex items-center gap-2 text-sm">
                      <Users className="w-4 h-4 text-blue-600" />
                      <span className="font-medium">Team:</span>
                      <span className="text-gray-700">{project.teamSize}</span>
                    </div>
                  </div>
                </div>

                {/* Partnerships */}
                <div>
                  <h4 className="text-lg font-semibold text-gray-900 mb-3 flex items-center gap-2">
                    <Building className="w-5 h-5 text-indigo-600" />
                    Key Partnerships
                  </h4>
                  <div className="space-y-1">
                    {project.partnerships.map((partnership, index) => (
                      <div key={index} className="flex items-center gap-2 text-sm text-gray-700">
                        <div className="w-2 h-2 bg-indigo-400 rounded-full"></div>
                        {partnership}
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        )}
      </AnimatePresence>
    </motion.div>
  );
};

export default ProjectCard;
